func lengthOfLongestSubstring(s string) int {

	var sl []string = strings.Split(s, "")
	if s == ""{
		return 0
	}

	n := 1
	for begin := 0; begin <= len(sl); begin++ {
		for end := begin; end <= len(sl); end++ {
			subList := sl[begin:end]
			if !Repeat(subList) {
				if len(subList) > n {
					n = len(subList)
				}
				if n== 95{
					break
				}
			}
		}
	}

	return n
}

